  \"2016-07-27T22:57:00.944860\",\n\t\"name\": \"crosby-wetland-management-district-including-lake-zahl-nwr-annual-narrative-report-calenda-d00af\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Crosby
  National Wildlife Refuge outlines Refuge accomplishments during the 1997 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. Refuge administration is outlined; information about
  personnel, youth programs, other manpower programs, volunteer programs, funding,
  safety, and technical assistance is given. Habitat management is also covered; subjects
  include wetlands, grasslands, grazing, haying, fire management, pest control, WPA
  easement monitoring, and private lands enhancement. The wildlife section of the
  report discusses endangered and threatened species, waterfowl, other migratory birds,
  game mammals, and other resident wildlife. The public uses of the Refuge described
  in this report include interpretive programs, hunting, and law enforcement. The
  equipment and facilities section of the report provides information about equipment
  utilization and replacement. Cooperative programs and items of interest are provided
  at the end. A brief narrative report for Lake Zahl National Wildlife Refuge is included.\",\n\t\"license_title\":
